Anacondas: The Hunt for the Blood Orchid (also known as Anaconda 2: The Black Orchid, Anaconda 2: The Hunt for the Blood Orchid, or just simply Anaconda 2) a 2004 horror-thriller film and sequel to the 1997 film Anaconda. It was directed by Dwight H. Little and was released in the United States on August 27, 2004. The plot of the movie entails a group of explorers looking for a sacred flower that they believe will bring humans a longer and healthier life, or maybe even cure cancer. The origin of the giant anaconda of the first film is also explained. The movie was followed by the made-for-television sequel Anaconda 3: Offspring.
